(function () {
    let seenBlocked = 0;
    let ratingShowed = false
    const ratingShowedEvent = new CustomEvent('ratingShowed', {});
    let active = false;
    window.addEventListener('message', function (e) {
        if (e.data.type === 'settings') {
            settings = JSON.parse(e.data.data);
            active = settings['enable-toggle']
            ratingShowed = settings['ratingShowed'] ?? false
        }
    });
    var origSend = XMLHttpRequest.prototype.send;
    XMLHttpRequest.prototype.send = function () {
        if (active && typeof arguments[0] === "string" && arguments[0].includes("viewSeenAt")) {
            if(seenBlocked >= 5 && !ratingShowed){
                let element = document.querySelector('[aria-label="Pause"]');

                window.dispatchEvent(ratingShowedEvent);
                document.getElementById("ratingModal").style.display = 'flex';
                ratingShowed = true;
                if(element){
                    element?.parentElement?.click()
                }
                console.log(seenBlocked)
            }
            seenBlocked++
        } else {
            origSend.apply(this, arguments);
        }
    };

    window.addEventListener('load', function () {
        addRatingModal();
    });

    function addRatingModal() {
        const modal = document.createElement('div');
        modal.id = 'ratingModal';
        modal.style.display = 'none';
        modal.style.position = 'fixed';
        modal.style.zIndex = '1000';
        modal.style.left = '0';
        modal.style.top = '0';
        modal.style.width = '100%';
        modal.style.height = '100%';
        modal.style.overflow = 'auto';
        modal.style.backgroundColor = 'rgba(0,0,0,0.4)'; // Black with opacity
        modal.style.alignItems = 'center'; // Align the modal content vertically center
        modal.style.justifyContent = 'center'; // Align the modal content horizontally center

// Create the modal content container
        const modalContent = document.createElement('div');
        modalContent.style.backgroundColor = '#fff';
        modalContent.style.margin = '30px auto';
        modalContent.style.border = '1px solid #888';
        modalContent.style.width = '40%'; // Width of the modal content
        modalContent.style.borderRadius = '10px'; // Rounded corners

// Add a close button
        const closeButton = document.createElement('span');
        closeButton.innerHTML = '&times;'; // Close button text (Ã—)
        closeButton.style.position = 'absolute';
        closeButton.style.top = '40px';
        closeButton.style.right = '25px';
        closeButton.style.color = '#1f1f1f';
        closeButton.style.fontSize = '28px';
        closeButton.style.fontWeight = 'bold';
        closeButton.style.cursor = 'pointer';
        closeButton.style.width = "31%"
        closeButton.onclick = function() {
            modal.style.display = 'none';
        };

        const title = document.createElement('h1');
        title.innerText = 'Help Us Grow';
        title.style.textAlign = 'center';
        title.style.fontSize = '2.5rem';
        title.style.color = "#2a2a2a"

        const subtitle = document.createElement('h1');
        subtitle.innerText = 'Enjoying our extension? Take a moment to rate us and share your experience on the Chrome Web Store!';
        subtitle.style.textAlign = 'center';
        subtitle.style.color = "#818181"
        subtitle.style.width = '300px'
        subtitle.style.margin = '0 auto'

        const image = document.createElement('img');
        image.src = imageContent; // Replace with your image path
        image.style.display = 'block';
        image.style.margin = 'auto';
        image.style.height = '300px'
        image.style.maxWidth = '100%';

        const actionButton = document.createElement('button');
        actionButton.innerText = 'Write a review';
        actionButton.style.display = 'block';
        actionButton.style.margin = '20px auto';
        actionButton.style.padding = '10px 20px';
        actionButton.style.fontSize = '18px';
        actionButton.style.backgroundColor = '#842AB6';
        actionButton.style.color = 'white';
        actionButton.style.border = 'none';
        actionButton.style.borderRadius = '5px'; // Rounded corners for the button
        actionButton.style.cursor = 'pointer';

        actionButton.onclick = function() {
            modal.style.display = 'none';
            const reviewUrl = 'https://chromewebstore.google.com/u/4/detail/ghostify-instagram-story/ajkkboilpcbfgojiochgfbeblbpcgpga?hl=en';
            window.open(reviewUrl, '_blank');
        };

// Append all elements to the modal content
        modalContent.appendChild(closeButton);
        modalContent.appendChild(image);
        modalContent.appendChild(title);
        modalContent.appendChild(subtitle);
        modalContent.appendChild(actionButton);

        modal.appendChild(modalContent);

        document.body.appendChild(modal);

    }
    const imageContent = 'data:image/png;base64,';
})();
